useEffect(() => {
    setUsername(sessionStorage.getItem("Username"));
    setPassword(sessionStorage.getItem("Password"));
    setLoginType(sessionStorage.getItem("LoginType"));

    fetch("/api/get-name", {
        method: 'POST',
        body: JSON.stringify({data: [sessionStorage.getItem("Username"), sessionStorage.getItem("Password"), sessionStorage.getItem("LoginType")]}),
        headers: {
            'Content-Type': 'application/json'
        }
    })
    .then(response => response.json())
    .then(data => {
        if (data === "INVALID") {
            alert("Access Denied.");
        }
        else {
            setName(data);
        }
    })
}, []);

